p_wv: .word 0 # player velocity on w axis
p_st: .word 0 # is_stand
p_al: .word 0 # is_alive

# Platforms info
pf_h: .word 0:PF_C # h of platforms
pf_w: .word 0:PF_C # w of platforms

# Rockets info
rk_h: .word 0:RK_C # h of rockets
rk_w: .word 0:RK_C # w of rockets

# Coins info
co_h: .word 0:CO_C # h of coins
co_w: .word 0:CO_C # w of coins

#####################################################################

.text
.globl main
main:
	# Init the music player
	li $s0, 0
	sw $s0, music_rt
	la $s0, background_music
	sw $s0, music_p
main_start:
	# draw start menu
	la $a0, menu_img
	li $a1, 0
	li $a2, 0
	jal draw_image
	la $a0, cursor_img
	li $a1, I_CURSOR_ST_H
	li $a2, I_CURSOR_ST_W
	jal draw_image
	# s2: the choice, 0: start, 1: exit
	li $s2, 0
main_menu_loop:
	jal frame_sync_init
	# Music!
	jal play_music
	# Check keyboard
	li $s0, 0xffff0000
	lw $s1, 0($s0)
	bne $s1, 1, main_menu_loop_NXT
	lw $s1, 4($s0)
	beq $s1, 119, main_menu_loop_keyboard_press_ws
	beq $s1, 115, main_menu_loop_keyboard_press_ws
	beq $s1, 100, main_menu_loop_keyboard_press_d
	j main_menu_loop_NXT
main_menu_loop_keyboard_press_d:
	beqz $s2, main_init_game
	j main_EXIT
main_menu_loop_keyboard_press_ws:
	xori $s2, $s2, 1
	beqz $s2, main_menu_draw_start
	# Erase old cursor
	li $a0, I_CURSOR_ST_H
	li $a1, I_CURSOR_ST_W
	li $a2, CURSOR_H
	li $a3, CURSOR_W
	jal erase
	li $a1, I_CURSOR_EX_H
	li $a2, I_CURSOR_EX_W
	j main_menu_draw
main_menu_draw_start:
	# Erase old cursor
	li $a0, I_CURSOR_EX_H
	li $a1, I_CURSOR_EX_W
	li $a2, CURSOR_H
	li $a3, CURSOR_W
	jal erase
	li $a1, I_CURSOR_ST_H
	li $a2, I_CURSOR_ST_W
main_menu_draw:
	la $a0, cursor_img
	jal draw_image
main_menu_loop_NXT:
	jal frame_sync_delay
	j main_menu_loop
main_init_game:
	# Init game info
	li $s0, 0
	sw $s0, main_cnt
	sw $s0, score_cnt
	# Init player info
	# p_h = G_L - P_H
	li $s0, G_L
	subi $s0, $s0, P_H
	sw $s0, p_h
	# p_w = 15
	li $s0, 15
	sw $s0, p_w
	# p_hv = 0
	li $s0, 0
	sw $s0, p_hv
	# p_wv = P_DFSP
	li $s0, P_DFSP
	sw $s0, p_wv
	# p_st = 1 (true)
	li $s0, 1
	sw $s0, p_st
	# p_al = 1 (true)
	li $s0, 1
	sw $s0, p_al
	# Init platforms' info
	# generate outside the screen
	li $s0, 0
	la $s1, pf_h
	la $s2, pf_w
main_init_platform_loop:
	bge $s0, PF_C, main_init_platform_loop_END
	li $s3, PF_L
	sw $s3, 0($s1)
	li $s3, -1
	sw $s3, 0($s2)
	move $a0, $s0
	jal reset_platform
	addi $s0, $s0, 1
	addi $s1, $s1, 4
	addi $s2, $s2, 4
	j main_init_platform_loop
main_init_platform_loop_END:
	# Init rockets' info
	li $s0, 0
main_init_rocket_loop:
	bge $s0, RK_C, main_init_rocket_loop_END
	move $a0, $s0
	jal reset_rocket
	addi $s0, $s0, 1
	j main_init_rocket_loop
main_init_rocket_loop_END:
	# Init coins' info
	li $s0, 0
main_init_coin_loop:
	bge $s0, CO_C, main_init_coin_loop_END
	move $a0, $s0
	jal reset_coin
	addi $s0, $s0, 1
	j main_init_coin_loop
main_init_coin_loop_END:
	# Clean the screen by erase(0, 0, S_H, S_W)
	li $a0, 0
	li $a1, 0
	li $a2, S_H
	li $a3, S_W
	jal background_erase
	# Draw ground
	la $a0, ground_img
	li $a1, G_L
	li $a2, 0
	jal draw_image
	# Draw score_img
	la $a0, score_img
	li $a1, I_SCORE_H
	li $a2, I_SCORE_W
	jal draw_image
	# Draw best_img
	la $a0, best_img
	li $a1, I_BEST_H
	li $a2, I_BEST_W
	jal draw_image
	# Draw best (digits)
	lw $a0, best_cnt
	li $a1, I_BEST_D_D
	li $a2, I_BEST_D_H
	li $a3, I_BEST_D_W
	jal draw_digits
main_loop:
	jal frame_sync_init
	# Music!
	jal play_music
	# Skip the game logic if main_cnt % FRM != 0
	lw $s0, main_cnt
	li $s1, 1
	sll $s1, $s1, FRMB
	subi $s1, $s1, 1
	and $s0, $s0, $s1
	bnez $s0, main_loop_NXT
	# Erase the cat (optimized by p_hv)
	lw $s0, p_hv
	bltz $s0, main_erase_cat_negative
	# otherwise p_hv is positive (i.e. falling)
	lw $a0, p_h
	lw $a1, p_w
	move $a2, $s0
	li $a3, P_W
	# if a2 > P_H then a2 = P_H
	ble $a2, P_H, main_erase_cat_erase
	li $a2, P_H
	j main_erase_cat_erase
main_erase_cat_negative:
	# if s0 < -P_H then s0 = -PH
	bge $s0, -P_H, main_erase_cat_negative_NXT
	li $s0, -P_H
main_erase_cat_negative_NXT:
	lw $a0, p_h
	addi $a0, $a0, P_H
	add $a0, $a0, $s0
	lw $a1, p_w
	# a2 = -s0
	li $a2, 0
	sub $a2, $a2, $s0
	li $a3, P_W
main_erase_cat_erase:
	jal background_erase
main_erase_cat_END:
	# Update player position
	lw $s0, p_h
	lw $s1, p_hv
	add $s0, $s0, $s1
	sw $s0, p_h
	# Check collisions
	# firstly assume there's no collisions, so set p_st = 0 (false)
	li $s0, 0
	sw $s0, p_st
	# if player touch the ground (p_h + P_H >= G_L)
	lw $s0, p_h
	addi $s0, $s0, P_H
	blt $s0, G_L, main_ground_collision_END
	# p_st = 1 (true)
	li $s0, 1
	sw $s0, p_st
	# p_h = G_L - P_H
	li $s0, G_L
	subi $s0, $s0, P_H
	sw $s0, p_h
	# p_hv = 0
	li $s0, 0
	sw $s0, p_hv
main_ground_collision_END:
	# if p_st = 0 (false) and p_hv >= 0 (falling) then check collisions with platforms
	lw $s0, p_st
	bnez $s0, main_platform_collision_END
	lw $s0, p_hv
	bltz $s0, main_platform_collision_END
	li $s0, 0
	la $s1, pf_h
	la $s2, pf_w
main_platform_collision_loop:
	bge $s0, PF_C, main_platform_collision_END
	lw $a0, 0($s1)
	lw $a1, 0($s2)
	li $a2, 1 # only the top of the cloud has collision body
	li $a3, PF_W
	jal check_collision
	# if there is no collision, then continue
	beqz $v0, main_platform_collision_loop_NXT
	# p_st = 1 (true)
	li $s0, 1
	sw $s0, p_st
	# need to erase the cat again to fix the afterimage caused by erase optimization
	lw $s0, p_h
	# s1 = a0 - P_H (new p_h)
	subi $s1, $a0, P_H
	# a0 = s0 + P_H - (s0 - s1) = P_H + s1
	addi $a0, $s1, P_H
	# a1 = p_w
	lw $a1, p_w
	# a2 = s0 - s1
	sub $a2, $s0, $s1
	li $a3, P_W
	jal background_erase
	# set new p_h
	sw $s1, p_h
	# p_hv = 0
	li $s0, 0
	sw $s0, p_hv
	j main_platform_collision_END
main_platform_collision_loop_NXT:
	addi $s0, $s0, 1
	addi $s1, $s1, 4
	addi $s2, $s2, 4
	j main_platform_collision_loop
main_platform_collision_END:
	# if p_al = 0 (false) and p_st = 1 (true) then end the game
	lw $s0, p_al
	bnez $s0, main_rocket_collision
	lw $s0, p_st
	beqz $s0, main_rocket_collision
	j main_gg
main_rocket_collision:
	# Check collisions with rockets
	li $s0, 0
	la $s1, rk_h
	la $s2, rk_w
main_rocket_collision_loop:
	bge $s0, RK_C, main_rocket_collision_END
	lw $a0, 0($s1)
	lw $a1, 0($s2)
	li $a2, RK_H
	li $a3, RK_W
	jal check_collision
	# if there is no collision, then continue
	beqz $v0, main_rocket_collision_loop_NXT
	li $s0, 0
	sw $s0, p_wv
	sw $s0, p_al
	li $s0, P_DJV
	sw $s0, p_hv
	j main_rocket_collision_END
main_rocket_collision_loop_NXT:
	addi $s0, $s0, 1
	addi $s1, $s1, 4
	addi $s2, $s2, 4
	j main_rocket_collision_loop
main_rocket_collision_END:
	# Check collisions with coins
	li $s0, 0
	la $s1, co_h
	la $s2, co_w
main_coin_collision_loop:
	bge $s0, CO_C, main_coin_collision_END
	lw $s3, 0($s1)
	lw $s4, 0($s2)
	move $a0, $s3
	move $a1, $s4
	li $a2, CO_H
	li $a3, CO_W
	jal check_collision
	# if there is no collision, then continue
	beqz $v0, main_coin_collision_loop_NXT
	move $a0, $s3
	move $a1, $s4
	li $a2, CO_H
	li $a3, CO_W
	jal background_erase
	move $a0, $s0
	jal reset_coin
	# score_cnt += CO_S
	lw $s0, score_cnt
	addi $s0, $s0, CO_S
	sw $s0, score_cnt
	# Sound effect
	li $v0, 31
	li $a0, 127
	li $a1, 1000
	li $a2, 112
	li $a3, 127
	syscall
main_coin_collision_loop_NXT:
	addi $s0, $s0, 1
	addi $s1, $s1, 4
	addi $s2, $s2, 4
	j main_coin_collision_loop
main_coin_collision_END:
	# Update player velocity if p_st is false
	lw $s0, p_st
	bnez $s0, main_update_v_END
	lw $s0, p_hv
	addi $s0, $s0, G
	sw $s0, p_hv
main_update_v_END:
	# Check keyboard
	li $s0, 0xffff0000
	lw $s1, 0($s0)
	bne $s1, 1, main_keyboard_END
	lw $s1, 4($s0)
	beq $s1, 112, main_keyboard_press_p
	# if p_al = 0 (false) then ignore player moves
	lw $s0, p_al
	beqz $s0, main_keyboard_END
	beq $s1, 119, main_keyboard_press_w
	beq $s1, 97, main_keyboard_press_a
	beq $s1, 100, main_keyboard_press_d
	j main_keyboard_END
main_keyboard_press_w:
	# if p_st is false, then do nothing
	lw $s0, p_st
	beqz $s0, main_keyboard_END
	# p_hv = P_JV
	li $s0, P_JV
	sw $s0, p_hv
	# p_st = false
	li $s0, 0
	sw $s0, p_st
	j main_keyboard_END
main_keyboard_press_a:
	# if p_wv <= P_MNSP, then do nothing
	lw $s0, p_wv
	ble $s0, P_MNSP, main_keyboard_END
	# p_wv -= 1
	addi $s0, $s0, -1
	sw $s0, p_wv
	j main_keyboard_END
main_keyboard_press_d:
	# if p_wv >= P_MXSP, then do nothing
	lw $s0, p_wv
	bge $s0, P_MXSP, main_keyboard_END
	# p_wv += 1
	addi $s0, $s0, 1
	sw $s0, p_wv
	j main_keyboard_END
main_keyboard_press_p:
	j main_start
main_keyboard_END:
	# If p_al = 0 (false), choose cat_dead_img
	lw $s0, p_al
	beqz $s0, main_draw_dead_cat
	# s0 = main_cnt // FRM
	lw $s0, main_cnt
	sra $s0, $s0, FRMB
	# Set s1 = s0 % 4 (for animation)
	andi $s1, $s0, 3
	# draw cat_frame(s1)
	beq $s1, 0, main_draw_frame0
	beq $s1, 1, main_draw_frame1
	beq $s1, 2, main_draw_frame2
	j main_draw_frame3
main_draw_dead_cat:
	la $a0, cat_dead_img
	j main_draw_player
main_draw_frame3:
	la $a0, cat_frame3
	j main_draw_player
main_draw_frame2:
	la $a0, cat_frame2
	j main_draw_player
main_draw_frame1:
	la $a0, cat_frame1
	j main_draw_player
main_draw_frame0:
	la $a0, cat_frame0
	j main_draw_player
main_draw_player:
	lw $a1, p_h
	lw $a2, p_w
	jal draw_image
	# update platforms and draw them
	li $s0, 0
	la $s1, pf_h
	la $s2, pf_w
main_update_platform_loop:
	bge $s0, PF_C, main_update_platform_loop_END
	lw $s3, 0($s1) # h[i]
	lw $s4, 0($s2) # w[i]
	lw $s5, p_wv
	# erase the old part
	addi $a1, $s4, PF_W
	sub $a1, $a1, $s5
	move $a0, $s3
	li $a2, PF_H
	move $a3, $s5
	jal background_erase
	# update the platform's position
	sub $s4, $s4, $s5
	# if the platform disappear, then reset it
	blt $s4, -PF_W, main_update_platform_loop_reset
	# otherwise, just update it
	sw $s4, 0($s2)
	j main_update_platform_loop_draw
main_update_platform_loop_reset:
	move $a0, $s0
	jal reset_platform
	lw $s4, 0($s2)
main_update_platform_loop_draw:
	# draw the platform
	la $a0, platform_img
	move $a1, $s3
	move $a2, $s4
	jal draw_image
	# main_update_platform_loop_nxt
	addi $s0, $s0, 1
	addi $s1, $s1, 4
	addi $s2, $s2, 4
	j main_update_platform_loop
main_update_platform_loop_END:
	# update rockets and draw them
	li $s0, 0
	la $s1, rk_h
	la $s2, rk_w
main_update_rocket_loop:
	bge $s0, RK_C, main_update_rocket_loop_END
	lw $s3, 0($s1) # h[i]
	lw $s4, 0($s2) # w[i]
	lw $s5, p_wv
	addi $s5, $s5, RK_SP
	# erase the old part
	addi $a1, $s4, RK_W
	sub $a1, $a1, $s5
	move $a0, $s3
	li $a2, RK_H
	move $a3, $s5
	jal background_erase
	# update the rocket's position
	sub $s4, $s4, $s5
	# if the rocket disappear, then reset it
	blt $s4, -RK_W, main_update_rocket_loop_reset
	# otherwise, just update it
	sw $s4, 0($s2)
	j main_update_rocket_loop_draw
main_update_rocket_loop_reset:
	move $a0, $s0
	jal reset_rocket
	lw $s4, 0($s2)
main_update_rocket_loop_draw:
	# draw the rocket
	la $a0, rocket_img
	move $a1, $s3
	move $a2, $s4
	jal draw_image
	# main_update_rocket_loop_nxt
	addi $s0, $s0, 1
	addi $s1, $s1, 4
	addi $s2, $s2, 4
	j main_update_rocket_loop
main_update_rocket_loop_END:
	# update coins and draw them
	li $s0, 0
	la $s1, co_h
	la $s2, co_w
main_update_coin_loop:
	bge $s0, CO_C, main_update_coin_loop_END
	lw $s3, 0($s1) # h[i]
	lw $s4, 0($s2) # w[i]
	lw $s5, p_wv
	# erase the old part
	addi $a1, $s4, CO_W
	sub $a1, $a1, $s5
	move $a0, $s3
	li $a2, CO_H
	move $a3, $s5
	jal background_erase
	# update the coin's position
	sub $s4, $s4, $s5
	# if the coin disappear, then reset it
	blt $s4, -CO_W, main_update_coin_loop_reset
	# otherwise, just update it
	sw $s4, 0($s2)
	j main_update_coin_loop_draw
main_update_coin_loop_reset:
	move $a0, $s0
	jal reset_coin
	lw $s4, 0($s2)
main_update_coin_loop_draw:
	# draw the coin
	la $a0, coin_img
	move $a1, $s3
	move $a2, $s4
	jal draw_image
	# main_update_coin_loop_nxt
	addi $s0, $s0, 1
	addi $s1, $s1, 4
	addi $s2, $s2, 4
	j main_update_coin_loop
main_update_coin_loop_END:
	# Draw score (digits)
	lw $a0, score_cnt
	li $a1, I_SCORE_D_D
	li $a2, I_SCORE_D_H
	li $a3, I_SCORE_D_W
	jal draw_digits
	# Score += p_wv
	lw $s0, score_cnt
	lw $s1, p_wv
	add $s0, $s0, $s1
	sw $s0, score_cnt
main_loop_NXT:
	jal frame_sync_delay
	# main_cnt += 1
	lw $s0, main_cnt
	addi $s0, $s0, 1
	sw $s0, main_cnt
	j main_loop
main_gg:
	# Sleep 2 second
	#li $v0, 32
	#li $a0, 2000
	#syscall
	lw $s0, score_cnt
	lw $s1, best_cnt
	bgt $s0, $s1, main_gg_win
	# lose
	la $a0, lose_img
	j main_gg_draw
main_gg_win:
	sw $s0, best_cnt
	la $a0, win_img
main_gg_draw:
	li $a1, 0
	li $a2, 0
	jal draw_image
	# Draw score (digits)
	move $a0, $s0
	li $a1, I_SCORE_D_D
	li $a2, I_FINAL_D_H
	li $a3, I_FINAL_D_W
	jal draw_digits
main_gg_loop:
	jal frame_sync_init
	# Music!
	jal play_music
	# Check keyboard
	li $s0, 0xffff0000
	lw $s1, 0($s0)
	bne $s1, 1, main_gg_loop_NXT
	lw $s1, 4($s0)
	beq $s1, 112, main_gg_loop_keyboard_press_p
	j main_gg_loop_NXT
main_gg_loop_keyboard_press_p:
	j main_start
main_gg_loop_NXT:
	jal frame_sync_delay
	j main_gg_loop
main_EXIT:
	# End program
	li $v0, 10
	syscall

# -------------------------------------------------------------------
# draw_image
# a0: address of the image
# a1: start h
# a2: start w
# -------------------------------------------------------------------
draw_image:
	# t1, t2: dh, dw
	li $t1, 0
	# t3, t4: img_h, img_w
	lw $t3, 0($a0)
	lw $t4, 4($a0)
	# t5: reading address
	addi $t5, $a0, 8
draw_image_L1:
	# if dh >= img_h then break
	bge $t1, $t3, draw_image_L1_END
	# t0 = S_BS + ((a1 + t1) * S_W + a2) * 4 (the first writting address of this line)
	add $t0, $a1, $t1
	sll $t0, $t0, S_WB
	add $t0, $t0, $a2
	sll $t0, $t0, 2
	addi $t0, $t0, S_BS
	# Set t2 to 0
	li $t2, 0
draw_image_L2:
	# if dw >= img_w then break
	bge $t2, $t4, draw_image_L2_END
	# if dh + a1 < 0 or dh + a1 >= S_H then continue
	add $t6, $t1, $a1
	bltz $t6, draw_image_L2_NXT
	bge $t6, S_H, draw_image_L2_NXT
	# if dw + a2 < 0 or dw + a2 >= S_W then continue
	add $t6, $t2, $a2
	bltz $t6, draw_image_L2_NXT
	bge $t6, S_W, draw_image_L2_NXT
	# Copy the pixel
	lw $t6, 0($t5)
	sw $t6, 0($t0)
draw_image_L2_NXT:
	addi $t2, $t2, 1
	addi $t0, $t0, 4
	addi $t5, $t5, 4
	j draw_image_L2
draw_image_L2_END:
	addi $t1, $t1, 1
	j draw_image_L1
draw_image_L1_END:
	jr $ra

# -------------------------------------------------------------------
# erase
# a0: start h
# a1: start w
# a2: height
# a3: weidth
# -------------------------------------------------------------------
erase:
	# t1, t2: h, w
	move $t1, $a0
	# change a2, a3 to end h, end w
	add $a2, $a2, $a0
	add $a3, $a3, $a1
erase_L1:
	# if h >= a2 then break
	bge $t1, $a2, erase_L1_END
	# t0 = S_BS + (t1 * S_W + a1) * 4 (the first writting address of this line)
	move $t0, $t1
	sll $t0, $t0, S_WB
	add $t0, $t0, $a1
	sll $t0, $t0, 2
	addi $t0, $t0, S_BS
	# Set t2 to a1
	move $t2, $a1
erase_L2:
	# if w >= a3 then break
	bge $t2, $a3, erase_L2_END
	# if h < 0 or h >= S_H then continue
	bltz $t1, erase_L2_NXT
	bge $t1, S_H, erase_L2_NXT
	# if w < 0 or w >= S_W then continue
	bltz $t2, erase_L2_NXT
	bge $t2, S_W, erase_L2_NXT
	li $t3, C_BG
	sw $t3, 0($t0)
erase_L2_NXT:
	addi $t2, $t2, 1
	addi $t0, $t0, 4
	j erase_L2
erase_L2_END:
	addi $t1, $t1, 1
	j erase_L1
erase_L1_END:
	jr $ra

# -------------------------------------------------------------------
# background_erase
# Instead of using backgroud color, this bad boy fills the empty
# pixels with corresponding pixels from an image (backgroud_img)
# a0: start h
# a1: start w
# a2: height
# a3: weidth
# -------------------------------------------------------------------
background_erase:
	# t4: backgroud_img + 8
	la $t4, background_img
	addi $t4, $t4, 8
	# t1, t2: h, w
	move $t1, $a0
	# change a2, a3 to end h, end w
	add $a2, $a2, $a0
	add $a3, $a3, $a1
background_erase_L1:
	# if h >= a2 then break
	bge $t1, $a2, background_erase_L1_END
	# t0 = S_BS + (t1 * S_W + a1) * 4 (the first writting address of this line)
	move $t0, $t1
	sll $t0, $t0, S_WB
	add $t0, $t0, $a1
	sll $t0, $t0, 2
	# t5 = t4 + (t1 * S_W + a1) * 4
	add $t5, $t4, $t0
	addi $t0, $t0, S_BS
	# Set t2 to a1
	move $t2, $a1
background_erase_L2:
	# if w >= a3 then break
	bge $t2, $a3, background_erase_L2_END
	# if h < 0 or h >= S_H then continue
	bltz $t1, background_erase_L2_NXT
	bge $t1, S_H, background_erase_L2_NXT
	# if w < 0 or w >= S_W then continue
	bltz $t2, background_erase_L2_NXT
	bge $t2, S_W, background_erase_L2_NXT
	# Copy the pixel
	lw $t3, 0($t5)
	sw $t3, 0($t0)
background_erase_L2_NXT:
	addi $t2, $t2, 1
	addi $t0, $t0, 4
	addi $t5, $t5, 4
	j background_erase_L2
background_erase_L2_END:
	addi $t1, $t1, 1
	j background_erase_L1
background_erase_L1_END:
	jr $ra

# -------------------------------------------------------------------
# draw_digits
# a0: the (positive) integer to draw
# a1: number of digits to draw
# a2: start h
# a3: start w
# -------------------------------------------------------------------
draw_digits:
	# Copy parameters
	move $t0, $a0
	move $t1, $a1
	move $t2, $a2
	move $t3, $a3
	# Set t4 to the last (excluded) digit's w: t3 + t1 * DG_W
	li $t4, DG_W
	mult $t4, $t1
	mflo $t4
	add $t4, $t4, $t3
draw_digits_loop:
	blez $t1, draw_digits_loop_END
	# t4 -= DG_W
	subi $t4, $t4, DG_W
	# t5 = t0 % 10, t0 //= 10
	li $t5, 10
	div $t0, $t5
	mflo $t0
	mfhi $t5
	beq $t5, 1, draw_digits_loop_1
	beq $t5, 2, draw_digits_loop_2
	beq $t5, 3, draw_digits_loop_3
	beq $t5, 4, draw_digits_loop_4
	beq $t5, 5, draw_digits_loop_5
	beq $t5, 6, draw_digits_loop_6
	beq $t5, 7, draw_digits_loop_7
	beq $t5, 8, draw_digits_loop_8
	beq $t5, 9, draw_digits_loop_9
	# Otherwise, choose 0
	la $a0, zero_img
	j draw_digits_loop_draw
draw_digits_loop_1:
	la $a0, one_img
	j draw_digits_loop_draw
draw_digits_loop_2:
	la $a0, two_img
	j draw_digits_loop_draw
draw_digits_loop_3:
	la $a0, three_img
	j draw_digits_loop_draw
draw_digits_loop_4:
	la $a0, four_img
	j draw_digits_loop_draw
draw_digits_loop_5:
	la $a0, five_img
	j draw_digits_loop_draw
draw_digits_loop_6:
	la $a0, six_img
	j draw_digits_loop_draw
draw_digits_loop_7:
	la $a0, seven_img
	j draw_digits_loop_draw
draw_digits_loop_8:
	la $a0, eight_img
	j draw_digits_loop_draw
draw_digits_loop_9:
	la $a0, nine_img
draw_digits_loop_draw:
	move $a1, $t2
	move $a2, $t4
	# Save ra, t0 - t4 in stack
	addi $sp, $sp, -24
	sw $ra, -20($sp)
	sw $t0, -16($sp)
	sw $t1, -12($sp)
	sw $t2, -8($sp)
	sw $t3, -4($sp)
	sw $t4, 0($sp)
	# Draw the digit
	jal draw_image
	# Restore t0 - t4
	lw $t4, 0($sp)
	lw $t3, -4($sp)
	lw $t2, -8($sp)
	lw $t1, -12($sp)
	lw $t0, -16($sp)
	lw $ra, -20($sp)
	addi $sp, $sp, 24
	# NXT
	subi $t1, $t1, 1
	j draw_digits_loop
draw_digits_loop_END:
	jr $ra

# -------------------------------------------------------------------
# check_collision
# Check collision between the player and another object
# a0: h of the object
# a1: w of the object
# a2: height of the object
# a3: weidth of the object
# -------------------------------------------------------------------
check_collision:
	# Load info of the player
	lw $t0, p_h
	lw $t1, p_w
	li $t2, P_H
	li $t3, P_W
	# change height / weidth to (h, w)
	add $t2, $t2, $t0
	add $t3, $t3, $t1
	add $a2, $a2, $a0
	add $a3, $a3, $a1
	# if a2 < t0 or t2 < a0 or a3 < t1 or t3 < a1 then false
	blt $a2, $t0, check_collision_false
	blt $t2, $a0, check_collision_false
	blt $a3, $t1, check_collision_false
	blt $t3, $a1, check_collision_false
	# return true
	li $v0, 1
	j check_collision_return
check_collision_false:
	# return false
	li $v0, 0
check_collision_return:
	jr $ra

# -------------------------------------------------------------------
# reset_platform
# a0: the id of the platform you want to reset
# -------------------------------------------------------------------
reset_platform:
	# a0 = a0 * 4
	sll $a0, $a0, 2
	# t1 = pf_w + a0
	la $t1, pf_w
	add $t1, $t1, $a0
	# pf_w[i] = max(max(pf_w) + PF_W, S_W) + rand(PF_R)
	li $t2, S_W
	li $t3, 0
	la $t4, pf_w
reset_platform_loop:
	bge $t3, PF_C, reset_platform_loop_END
	lw $t0, 0($t4)
	addi $t0, $t0, PF_W
	addi $t0, $t0, PF_M
	ble $t0, $t2, reset_platform_loop_NXT
	move $t2, $t0
reset_platform_loop_NXT:
	addi $t3, $t3, 1
	addi $t4, $t4, 4
	j reset_platform_loop
reset_platform_loop_END:
	li $v0, 42
	li $a0, 0
	li $a1, PF_R
	syscall
	add $t2, $t2, $a0
	sw $t2, 0($t1)
	jr $ra

# -------------------------------------------------------------------
# reset_rocket
# a0: the id of the rocket you want to reset
# -------------------------------------------------------------------
reset_rocket:
	# a0 = a0 * 4
	sll $a0, $a0, 2
	# t0 = rk_h + a0
	la $t0, rk_h
	add $t0, $t0, $a0
	# t1 = rk_w + a0
	la $t1, rk_w
	add $t1, $t1, $a0
	# randomize rk_h[i]
	li $v0, 41
	li $a0, 0
	syscall
	andi $a0, $a0, 1
	beqz $a0, reset_rocket_h_low
	# if a0 is odd, then set h to high
	li $a0, PF_L
	j reset_rocket_h_NXT
reset_rocket_h_low:
	li $a0, G_L
reset_rocket_h_NXT:
	# move the rocket to the level of our cat
	addi $a0, $a0, -P_H
	sw $a0, 0($t0)
	# rk_w[i] = S_W + rand(RK_R)
	li $t2, S_W
	li $v0, 42
	li $a0, 0
	li $a1, RK_R
	syscall
	add $t2, $t2, $a0
	sw $t2, 0($t1)
	jr $ra

# -------------------------------------------------------------------
# reset_rocket
# a0: the id of the rocket you want to reset
# -------------------------------------------------------------------
reset_coin:
	# a0 = a0 * 4
	sll $a0, $a0, 2
	# t0 = co_h + a0
	la $t0, co_h
	add $t0, $t0, $a0
	# t1 = co_w + a0
	la $t1, co_w
	add $t1, $t1, $a0
	# randomize co_h[i]
	li $v0, 41
	li $a0, 0
	syscall
	andi $a0, $a0, 1
	beqz $a0, reset_coin_h_low
	# if a0 is odd, then set h to high
	li $a0, PF_L
	j reset_coin_h_NXT
reset_coin_h_low:
	li $a0, G_L
reset_coin_h_NXT:
	addi $a0, $a0, -CO_H
	addi $a0, $a0, -1 # floating effect
	sw $a0, 0($t0)
	# co_w[i] = S_W + rand(CO_R)
	li $t2, S_W
	li $v0, 42
	li $a0, 0
	li $a1, CO_R
	syscall
	add $t2, $t2, $a0
	sw $t2, 0($t1)
	jr $ra

# -------------------------------------------------------------------
# play_music
# Wow! A music player!
# -------------------------------------------------------------------
play_music:
	beq $zero, MUSIC_ON, play_music_END
	lw $t0, music_rt
	subi $t0, $t0, DLY
	bgtz $t0, play_music_NXT
	# move to next note
	lw $t0, music_p
	lw $t1, 0($t0)
	bne $t1, -1, play_music_play
	# move the pointer back to the head
	la $t0, background_music
	sw $t0, music_p
	lw $t1, 0($t0)
play_music_play:
	lw $t2, 4($t0)
	beq $t1, 128, play_music_skip
	li $v0, 31
	move $a0, $t1
	li $a1, MUSIC_DLY
	li $a2, INSTRUMENT
	li $a3, VOLUMN
	syscall
play_music_skip:
	addi $t0, $t0, 8
	sw $t0, music_p
	move $t0, $t2
play_music_NXT:
	sw $t0, music_rt
play_music_END:
	jr $ra

# -------------------------------------------------------------------
# add64
# A 64bit add algorithm
# v1:v0 = a1:a0 + a3:a2 (hi: v1, a1, a3; lo: v0, a0, a2)
# -------------------------------------------------------------------
add64:
	addu $v0, $a0, $a2
	nor $a2, $a2, $zero
	sltu $a2, $a2, $a0
	addu $v1, $a2, $a1
	addu $v1, $v1, $a3
	jr $ra

# -------------------------------------------------------------------
# frame_sync_init
# Init the system time for consistent frame rate
# -------------------------------------------------------------------
frame_sync_init:
	li $v0, 30
	syscall
	sw $a0, time_lo
	sw $a1, time_hi
	jr $ra

# -------------------------------------------------------------------
# frame_sync_delay
# -------------------------------------------------------------------
frame_sync_delay:
	# Save ra
	addi $sp, $sp, 4
	sw $ra, 0($sp)
	# Get current game time
	li $v0, 30
	syscall
	move $t0, $a0
	move $t1, $a1
	# Load last game time
	lw $t2, time_lo
	lw $t3, time_hi
	# Calculate the difference
	nor $a0, $t2, $zero
	nor $a1, $t3, $zero
	li $a2, 1
	li $a3, 0
	jal add64
	move $a0, $t0
	move $a1, $t1
	move $a2, $v0
	move $a3, $v1
	jal add64
	move $t0, $v0
	# Sleep(Delay - difference)
	li $v0, 32
	li $a0, DLY
	sub $a0, $a0, $t0
	# if a0 < 0 then set a0 = 0
	bgez $a0, frame_sync_delay_call
	li $a0, 0
frame_sync_delay_call:
	syscall
	# Load ra
	lw $ra, 0($sp)
	addi $sp, $sp, -4
	jr $ra
